syntax = "proto3";
option csharp_namespace = "YSFreedom.Common.Protocol";


message ScenePlayOwnerCheckRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 4353;
	}

	int32 retcode = 1;
	uint32 play_id = 2;
	bool is_skip_match = 3;
	uint32 wrong_uid = 4;
	repeated uint32 param_list = 5;
}
